o.config.js  // webpack-cli 静态资源配置文件\n\nNode 目录结构\n\n        src\n        ├── app.config.js  // node 应用服务配置文件\n        ├── backend-mock  // mock 数据层\n        ├── controllers  // 路由层\n        ├── middlewares // 中间件\n        ├── routes.js // 路由根文件\n        ├── services  // 服务层\n        ├── static  // 静态资源文件\n        ├── utils  // utils 目录\n        └── views  // View 层\n\nstatic 目录结构\n\n        src/static\n        ├── common  // 通用模块\n        │   └── components\n        └── pages // 业务入口\n            └── Demo // 具体 page\n                ├── css\n                ├── images  // ejs 中引入图片，不走 webpack, js 中不 import 不会打包\n                ├── img  // css，js 相关图片\n                ├── index.js\n                └── js\n"},function(e,t){e.exports="## 存放 h5-market-web 特有中间件\n"},function(e,t){e.exports='# 用法\n` import SendOtp from "../SendOtp/index.js";`\n```HTML\nonRef(ref) {\n    this.child = ref;\n}\n\n\n<SendOtp\n    onRef={this.onRef}\n    setMobile={this.setMobile.bind(this)}\n    setOtpCode={this.setOtpCode.bind(this)}\n    setCaptchaCode={this.setCaptchaCode.bind(this)}\n    getMobileHandler={this.getMobileHandler}\n    showToast={this.showToast.bind(this)}\n    actionId={this.state.actionId}\n/> \n\n\nsetMobile (value) {\n    this.setState({\n        mobileNo: value\n    });\n}\nsetOtpCode (value) {\n    this.setState({\n        captchaCode: value\n    });\n}\nsetCaptchaCode (value) {\n    this.setState({\n        otpCode: value\n    });\n}\n\n```\n\n\n\n'},function(e,t){e.exports="## h5-mission-web\n\n## 安装依赖\n```\nlnpm i gulp -g && lnpm i pm2 -g\n```\n### Run\n```\nnpm run start\n## 静态资源文件打包\nnpm run static\n## node 服务启动\nnpm run server\n## node 服务停止\nnpm run stop\n```\n\n### 目录结构\n\n        ├── README.md\n        ├── config  // node 项目配置文件目录\n            ├── default.js  // 全局配置文件\n            ├── development.js  // 开发环境配置文件\n            ├── {APP_NAME}.json  // 环境变量配置文件\n            ├── log4js.js // cat 相关配置，无需配置\n            └── production.js // 生产环境配置文件\n        ├── gulpfile.js // 资源打包配置文件\n        ├── node_modules\n        ├── package.json\n        ├── process.json // pm2 启动配置文件\n        ├── releash.sh\n        ├── server.js // node 启动文件\n        ├── src\n        └── tongo.config.js  // webpack-cli 静态资源配置文件\n\nNode 目录结构\n\n        src\n        ├── app.config.js  // node 应用服务配置文件\n        ├── backend-mock  // mock 数据层\n        ├── controllers  // 路由层\n        ├── middlewares // 中间件\n        ├── routes.js // 路由根文件\n        ├── services  // 服务层\n        ├── static  // 静态资源文件\n        ├── utils  // utils 目录\n        └── views  // View 层\n\nstatic 目录结构\n\n        src/static\n        ├── common  // 通用模块\n        │   └── components\n        └── pages // 业务入口\n            └── Demo // 具体 page\n                ├── css\n                ├── images  // ejs 中引入图片，不走 webpack, js 中不 import 不会打包\n                ├── img  // css，js 相关图片\n                ├── index.js\n                └── js\n"},function(e,t){e.exports="## 存放 h5-mission-web 特有中间件"},function(e,t){e.exports=""},function(e,t){e.exports='# Lu Hybrid Tabs\n#Create By: CC 2016-10-21\n\n##开发TabsV2的原因\n1.原来的Tabs是先修改的点击状态,然后执行的回调函数。容易造成Tabs标签页状态和数据请求不同步,极限操作快速切换的情况加出问题。\n2.原来的Tabs被大量使用,所以开发TabsV2,避免影响原来组件的使用。而且从外部控制Tabs的状态,Tabs使用方式做出了修改。\n\n##Samples\nSamples中存在示例,和Tabs在一起,可以直接打开查看。\n\n#eg:\n```\n<TabsV2 tabs={["七日年化走势图","万份收益走势图"]} classNames="TabsPage-TabsPadding" callBack={this.setChart2} active={this.state.active}/>\n\nsetChart2(item,index){\n    //外部执行回调函数\n    this.selectIndex++;\n\n    if(this.selectIndex>4)\n    {\n      alert(\'超过5次,不切换了\');\n    }\n    else\n    {\n      this.setState({\n        active:index,\n      });\n    }\n  }\n ```\n\n\n\n\n#Parameters:\n1、tabs:每个tab的显示名称，可以是N个，自动计算平均大小。\n2、type:tabs样式类型。 目前有Default、Gray、Blue三种风格，缺省为“Default”。其它样式可以在Tabs.css中加。\n3、callBack:tab切页动作完成后执行回调函数，并返回当前Tab的索引。\n4、active: 默认激活那个Tabs，缺省为0，激活第一个Tabs。\n5、middleLine：Tabs中间的间隔线是否显示，缺省为“false”不显示。\n6、lineClass：Tabs上下的边框线是否显示（缺省显示"line-topbottom"，上下线）。\n7、classNames:""，自定义Tabs组件边框\n\n#Modified:\n1、CC：增加了“Blue”颜色样式。\n\n\n\n\n'},function(e,t){e.exports=""},function(e,t){e.exports="## h5-promo-web\n\n## 安装依赖\n```\nlnpm i gulp -g && lnpm i pm2 -g\n```\n### Run\n```\nnpm run start\n## 静态资源文件打包\nnpm run static\n## node 服务启动\nnpm run server\n## node 服务停止\nnpm run stop\n```\n\n### 目录结构\n\n        ├── README.md\n        ├── config  // node 项目配置文件目录\n            ├── default.js  // 全局配置文件\n            ├── development.js  // 开发环境配置文件\n            ├── {APP_NAME}.json  // 环境变量配置文件\n            ├── log4js.js // cat 相关配置，无需配置\n            └── production.js // 生产环境配置文件\n        ├── gulpfile.js // 资源打包配置文件\n        ├── node_modules\n        ├── package.json\n        ├── process.json // pm2 启动配置文件\n        ├── releash.sh\n        ├── server.js // node 启动文件\n        ├── src\n        └── tongo.config.js  // webpack-cli 静态资源配置文件\n\nNode 目录结构\n\n        src\n        ├── app.config.js  // node 应用服务配置文件\n        ├── backend-mock  // mock 数据层\n        ├── controllers  // 路由层\n        ├── middlewares // 中间件\n        ├── routes.js // 路由根文件\n        ├── services  // 服务层\n        ├── static  // 静态资源文件\n        ├── utils  // utils 目录\n        └── views  // View 层\n\nstatic 目录结构\n\n        src/static\n        ├── common  // 通用模块\n        │   └── components\n        └── pages // 业务入口\n            └── Demo // 具体 page\n                ├── css\n                ├── images  // ejs 中引入图片，不走 webpack, js 中不 import 不会打包\n                ├── img  // css，js 相关图片\n                ├── index.js\n                └── js\n\nhttp://i.lu.com:8860/h5-promo/CADoubleCard User: xp_01/password001\n"},function(e,t){e.exports="## 存放 h5-promo-web 特有中间件"},function(e,t){e.exports="---\ncategory: '基本'\nsubCategory: 'ActionSheet 动作面板'\n---\n\n## ActionSheet 动作面板\n\n动作面板\n\n---\n\n### 代码演示\n\n```js\nclass Demo extends React.Component {\n  defaultClick() {\n    const actionSheet = ActionSheet.show({\n      data:  [{\n        value: 'ActionSheet1',\n        text: 'ActionSheet1'\n      }, {\n        value: 'ActionSheet2',\n        text: 'ActionSheet2',\n        type: 'warning',\n      }, {\n        value: 'ActionSheet3',\n        text: 'ActionSheet3',\n        type: 'disabled',\n      }, {\n        value: 'ActionSheet4',\n        text: 'ActionSheet4'\n      }],\n      onClick: (v, i) => {\n        console.log(v, i);\n        clearTimeout(timer);\n      },\n      onCancel: () => {\n        console.log('cancel');\n        clearTimeout(timer);\n      }\n    });\n\n    var timer = setTimeout(() => {\n      actionSheet.close();\n    }, 5000);\n  }\n  render() {\n    return (\n      <div>\n        <Button onClick={this.defaultClick}>默认modal</Button>\n      </div>\n    )\n  }\n}\n\n```\n\n### Api\n\n| 参数 | 说明 | 类型 | 默认值 | 必须 |\n| --- | --- | --- | ---  | --- |\n| className | 样式类名 | string | -- |  false |\n| mask | 是否需要遮罩 | boolean | true |  false |\n| data | 数据 | ActionSheetData[] | [] |  true |\n| cancelText | 取消显示 | string | 取消 |  false |\n\n#### ActionSheetData\n\n| 参数 | 说明 | 类型 | 默认值 | 必须 |\n| --- | --- | --- | ---  | --- |\n| value | 值 | any | -- |  false |\n| text | 显示的值 | any | -- |  true |\n| type | 类型 | primary: 普通 warning: 警示项 disabled: 不可选项 | primary |  false |\n\n##### 事件\n\n| 参数 | 说明 | 类型 | 参数 | 必须 |\n| --- | --- | --- | ---  | --- |\n| onClick | 单击回调 | (value: any, index: number) => void | value: ActionSheetData中的value , index: 点击的第几个index |  false |\n| onCancel | 取消回调 | () => {} | -- |  false |"},function(e,t){e.exports='---\ncategory: \'基本\'\nsubCategory: \'Button 按钮\'\n---\n\n\n## Button 按钮\n按钮分三种样式main, secondary, normal。\n\n---\n\n### 代码演示\n\n```js\nclass Demo extends React.Component {\n  render() {\n    return (\n      <div>\n        <div className="lu-button-con">\n          <Button type="main" onClick={()=>{ alert(\'button\') }}>默认按钮</Button>\n          <Button type="main" rounded>主要按钮</Button>\n          <Button type="main" disabled>文字按钮</Button>\n        </div>\n        <div className="lu-button-con">\n          <Button type="secondary">默认按钮</Button>\n          <Button type="secondary" rounded>主要按钮</Button>\n          <Button type="secondary" disabled>文字按钮</Button>\n        </div>\n        <div className="lu-button-con">\n          <Button type="normal">默认按钮</Button>\n          <Button type="normal" rounded>主要按钮</Button>\n          <Button type="normal" disabled>文字按钮</Button>\n        </div>\n      </div>\n    )\n  }\n}\n\n```\n\n### Api\n\n| 参数 | 说明 | 类型 | 默认值 | 必须 |\n| --- | --- | --- | ---  | --- |\n| type | 按钮类型 | "main" | "secondary" | "normal" | main |  false |\n| rounded | 是否为圆角 | boolean | false |  false |\n| disabled | 是否可用 | boolean | false |  false |\n| onClick | 点击事件 | () => void | -- |  false |\n| text | 按钮显示 | any | -- |  true |\n| className | 样式类名 | string | -- |  false |\n\n\n'},function(e,t){e.exports='---\ncategory: \'展示\'\nsubCategory: \'Badge 徽标数\'\n---\n\n## Badge 徽标数\n\n该元素置于容器的又上角;\n\n---\n\n### 代码演示\n\n```js\nclass Demo extends React.Component {\n  render() {\n    return (\n      <div className="lm-badge-con">\n        <div className="lm-badge1">\n          <Badge>Badge</Badge>\n        </div>\n        <div className="lm-badge2">\n          <Badge text="99+">Badge</Badge>\n        </div>\n      </div>\n    )\n  }\n}\n\n```\n\n### Api\n\n| 参数 | 说明 | 类型 | 默认值 | 必须 |\n| --- | --- | --- | ---  | --- |\n| text | 徽标上显示的值 | string | -- |  false |\n| className | 样式类名 | string | -- |  false |\n'},function(e,t){e.exports='---\ncategory: \'展示\'\nsubCategory: \'Carousel 轮播图\'\n---\n\n## Carousel \n\n轮播图（走马灯）\n\n---\n\n### 代码演示\n\n```js\nclass Demo extends React.Component {\n  render() {\n    return (\n      <Carousel autoplay={false}>\n        <a href="">< img src="https://static.lufaxcdn.com/wcm-images/UcuCOdQ4bJE5qGwNvDRIBA.jpg" /></a>\n        <a href="">< img src="https://static.lufaxcdn.com/wcm-images/Pu40SMbLYuUshPdIniOwsQ.png" /></a>\n        <a href="">< img src="https://static.lufaxcdn.com/wcm-images/Qw19GDhJMg2fqjSITnrtgg.jpg" /></a>\n        <a href="">< img src="https://static.lufaxcdn.com/wcm-images/UcuCOdQ4bJE5qGwNvDRIBA.jpg" /></a>\n        <a href="">< img src="https://static.lufaxcdn.com/wcm-images/Pu40SMbLYuUshPdIniOwsQ.png" /></a>\n        <a href="">< img src="https://static.lufaxcdn.com/wcm-images/Qw19GDhJMg2fqjSITnrtgg.jpg" /></a>\n      </Carousel>\n    )\n  }\n}\n```\n\n### Api\n\n| 参数 | 说明 | 类型 | 默认值 | 必须 |\n| --- | --- | --- | ---  | --- |\n| className | 样式类名 | string | -- |  false |\n| autoplay | 自动播放 | boolean | true | false |\n| adaptiveHeight | 自适应高度 | boolean | false | false |\n| autoplaySpeed | 自动播放速度 | number | 5000 | false |\n'},function(e,t){e.exports='---\ncategory: \'表单\'\nsubCategory: \'Checkbox 多选框\'\n---\n\n## Checkbox \n\n复选、单选组件\n\n\n---\n\n### 代码演示\n\n```js\nclass Demo extends React.Component {\n  render() {\n    return (\n      <div className="lm-checkbox-con">\n        <Checkbox onChange={checked => { checked ? Toast.show("选中了！") : Toast.show("取消了！") }}>\n          默认的checkbox\n        </Checkbox>\n        <Checkbox disabled={true} checked={true}>\n          disabled和选中的checkbox\n        </Checkbox>\n        <Checkbox type="circle">\n          圆的checkbox\n        </Checkbox>\n        <Checkbox type="circle" checked={true} disabled={true}>\n          disabled和选中的checkbox\n        </Checkbox>\n      </div>\n    )\n  }\n}\n\n\n\n```\n\n### Api\n\n| 参数 | 说明 | 类型 | 默认值 | 必须 |\n| --- | --- | --- | ---  | --- |\n| checked | 是否选中 | boolean | false |  false |\n| disabled | 是否禁用 | boolean | false |  false |\n| onChange | 改变时间 | (checked?: boolean) => void | -- |  false |\n| type | 类型 | "normal" | "circle" | normal |  true |\n| className | 样式类名 | string | -- |  false |\n'},function(e,t){e.exports="---\ncategory: '展示'\nsubCategory: 'DatePicker 日期选择器'\n---\n\n## DatePicker\n\nDatePicker\n\n---\n\n### 代码演示\n\n```js\nclass Demo extends React.Component {\n\n  componentDidMount() {\n     this.datePicker = new DatePicker({\n      minDate: new Date('2015/2/15'),\n      maxDate: new Date('2023/2/15'),\n      type: 'date',\n      onConfirm: (value) => {\n        Toast.show(`您选中的值是: ${value}`)\n      },\n      onCancel: () => {\n        Toast.show(`您点了取消`)\n      },\n      onValueChange(index, value) {\n        console.log(`您选择了第${index}列，选中的值为${value}`);\n      },\n      formatValue: 'YYYY-MM-DD',\n      formatDisplay: {\n        year: 'YYYY年',\n        month: 'MM月',\n        date: 'DD日',\n      }\n    });\n\n    this.datetimePicker = new DatePicker({\n      minDate: new Date('2015/2/15 00:00'),\n      maxDate: new Date('2023/2/15 23:59'),\n      type: 'datetime',\n      onConfirm: (value) => {\n        Toast.show(`您选中的值是: ${value}`)\n      },\n      onCancel: () => {\n        Toast.show(`您点了取消`)\n      },\n      onValueChange(index, value) {\n        console.log(`您选择了第${index}列，选中的值为${value}`);\n      },\n      formatValue: 'YYYY/MM/DD hh:mm',\n      formatDisplay: {\n        year: 'YYYY',\n        month: 'MM',\n        date: 'DD',\n      }\n    })\n\n\n    this.timePicker = new DatePicker({\n      minDate: new Date('2018/2/15 11:23'),\n      maxDate: new Date('2018/2/15 23:31'),\n      initialDate: new Date('2018/2/15 15:23'),\n      type: 'time',\n      onConfirm: (value) => {\n        Toast.show(`您选中的值是: ${value}`)\n      },\n      onCancel: () => {\n        Toast.show(`您点了取消`)\n      },\n      onValueChange(index, value) {\n        console.log(`您选择了第${index}列，选中的值为${value}`);\n      },\n      formatValue: 'hh : mm',\n      formatDisplay: {\n        hour: 'hh时',\n        minute: 'mm分',\n      }\n    })\n  }\n\n  dateClick() {\n    this.datePicker.show();\n  }\n\n  datetimeClick() {\n    this.datetimePicker.show();\n  }\n\n  timeClick() {\n    this.timePicker.show();\n  }\n\n\n  render() {\n    return (\n      <div  className='lm-picker-con'>\n        <Button onClick={this.dateClick.bind(this)}>date</Button>\n        <Button onClick={this.datetimeClick.bind(this)}>datetime</Button>\n        <Button onClick={this.timeClick.bind(this)}>time</Button>\n      </div>\n    )\n  }\n}\n\n```\n\n以 const picker = new DatePicker(options)方式使用，支持链式调用。\n\n#### 事件\n\n| 方法 | 说明 | 参数类型 | 返回 |\n| --- | --- | --- | -- |\n| show | 显示选择器 | -- | -- |\n| hide | 隐藏选择器 | -- | -- |\n\n#### options\n\n| 参数 | 说明 | 类型 | 默认值 | 必须 |\n| --- | --- | --- | ---  | --- |\n| className | 样式类名 | string | -- |  false |\n| cancelText | 取消文本 | React.ReactElement | 取消 |  false |\n| confirmText | 确定文本 | React.ReactElement | 确定 |  false |\n| title | 标题 | React.ReactElement | -- |  false |\n| minDate | 最小日期 | Date | new Date(1970, 1, 1) |  false |\n| maxDate | 最大日期 | Date | new Date(2060, 12, 31) |  false |\n| initialDate | 初始日期 | Date | new Date() |  false |\n| type | date:年月日，datetime:年月日时分 time：时分 | string | date |  false |\n| formatDisplay | 每一项显示的样式，{year: 'YYYY年', month: 'MM月', date: 'DD日', hour: 'hh', minute: 'mm'} | Object | {year: 'YYYY年', month: 'MM月', date: 'DD日', hour: 'hh', minute: 'mm'} |  false |\n| formatValue | 以type相关，输出结果格式。如YYYY/MM/DD hh:mm | string | YYYY/MM/DD |  false |\n\n#### 事件\n\n| 参数 | 说明 | 类型 | 参数 | 必须 |\n| --- | --- | --- | ---  | --- |\n| onValueChange | 值改变回调 | (index: number, value: any) => void | index: 改变的列索引，value: 滚动停止时的值 |  false |\n| onCancel | 取消回调 | () => void | -- |  false |\n| onConfirm | 确定回调 | (date： string) => void | 得到选中结果，与formatValue配置相关 |  false |"},function(e,t){e.exports="---\ncategory: '基本'\nsubCategory: 'EditableLabel'\n---\n\n\n## EditableLabel\n\n---\n\n### 代码演示\n\n```js\nclass Demo extends React.Component {\n  render() {\n    return (\n      <EditableLabel\n        label=\"标签\"\n        value=\"示例内容\"\n        onChange={value => console.log('onChange', value)}\n        onFocus={value => console.log('onFocus', value)}\n        onBlur={value => { console.log('onBlur', value)}} />\n    )\n  }\n}\n\n```\n\n### Api\n\n| 参数 | 说明 | 类型 | 默认值 | 必须 |\n| --- | --- | --- | ---  | --- |\n| type | 按钮类型 | \"main\" | \"secondary\" | \"normal\" | main |  false |\n| rounded | 是否为圆角 | boolean | false |  false |\n| disabled | 是否可用 | boolean | false |  false |\n| onClick | 点击事件 | () => void | -- |  false |\n| text | 按钮显示 | any | -- |  true |\n| className | 样式类名 | string | -- |  false |\n\n\n"},function(e,t){e.exports="---\ncategory: '基本'\nsubCategory: 'Flex 布局'\n---\n\n## Flex 布局\nFlex布局\n\n\n---\n\n### 代码演示\n\n```js\nclass Demo extends React.Component {\n  spacing = [10, 10, 10, 10];\n  render() {\n    return (\n      <Flex rowItemsCount={4} spacing={this.spacing}>\n        <div className=\"item\" data-flex={3}>1</div>\n        <div data-flex={2}>2</div>\n        <div data-flex={'1 1 auto'}>3</div>\n        <div>4</div>\n        <div>5</div>\n        <div>6</div>\n        <div>7</div>\n      </Flex>\n    )\n  }\n}\n```\n\n### Api\n\n| 参数 | 说明 | 类型 | 默认值 | 必须 |\n| --- | --- | --- | ---  | --- |\n| className | 样式类名 | string | -- |  false |\n| gap | flex子元素之间的间距 | ReactText | 0 |  false |\n| flex | 指定flex-grow 、flex-shrink、flex-basis | ReactText | 1 |  false |\n| direction | 指定flex-direction | string | row |  false |\n| align | 指定align-items | string | start |  false |\n| justify | 指定justify-content | string | start |  false |\n| alignContent | 指定align-content | string | stretch |  false |\n| wrap | 指定flex-wrap | string | undefined |  false |\n| rowItemsCount | 指定每行排多少个元素。当指定每行排的元素小于子元素总数时，超过的元素自动换行排列 | number | undefined |  false |\n| spacing | 上下左右和边界间的间距 | number[] | -- |  false |\n"},function(e,t){e.exports="---\ncategory: '展示'\nsubCategory: 'Form 表单'\n---\n\n## Form\n\nForm\n\n---\n\n### 代码演示\n\n```js\nclass Demo extends React.Component {\n  update() {\n    this.form.update({\n      idNumber: {\n        right: '更新得来额'\n      },\n      qixian: {\n        right: '5年'\n      },\n      birthday: {\n        right: 'wahaha',\n        initialDate: new Date('1999/01/01')\n      }\n    })\n  }\n\n  remove() {\n    this.form.remove(['isSelf'])\n  }\n\n  add() {\n    this.form.add([{\n      elementIndex: 0,\n      type: 'label',\n      left: '添加的',\n      right: '啦啦啦啦',\n      key: 'add',\n    }])\n  }\n\n  onChange(formData, key, value) {\n    console.log(formData, key, value);\n    this.form.update({\n      idNumber: {\n        right: '更新得来额'\n      },\n      qixian: {\n        right: '5年'\n      },\n      birthday: {\n        right: 'wahaha',\n        initialDate: new Date('1999/01/01')\n      }\n    })\n  }\n\n  render() {\n    const elements = [{\n      type: 'label',\n      left: '保险期限',\n      right: '1年',\n      key: 'qixian',\n      itemExtra: <p>这是测试的大声道撒多撒多撒大所大所多撒打算的撒打算的撒非官方的范德萨</p>,\n    }, {\n      type: 'picker',\n      left: '年度保额',\n      right: '五万元',\n      key: 'baoe',\n      pickerValueFormat: (value) => { return value.join('.')},\n      data: [[{ value: '五万元', text: '五万元' }, { value: '十万元', text: '十万元' }, { value: '二十万元', text: '二十万元' }]],\n    }, {\n      type: 'checkbox',\n      left: '为本人投保',\n      key: 'isSelf',\n      right: false,\n    }, {\n      type: 'input',\n      left: '证件号码',\n      key: 'idNumber',\n      placeholder: '请输入',\n    }, {\n      type: 'datePicker',\n      left: '出生日期',\n      key: 'birthday',\n      right: '请选择',\n      initialDate: new Date('1990/01/01')\n    }, {\n      type: 'editableLabel',\n      left: '电话',\n      key: 'editableLabel',\n      right: '15895864920',\n    },]\n\n    return (\n      <div  className='lm-form-con'>\n        <Form form={(form) => { this.form = form }} onChange={this.onChange.bind(this)} elements={elements} />\n        <Button onClick={this.update.bind(this)}  text=\"更新\" />\n        <Button onClick={this.remove.bind(this)}  text=\"删除\" />\n        <Button onClick={this.add.bind(this)}  text=\"添加\" />\n      </div>\n    )\n  }\n}\n\n```\n\n#### Api\n\n| 参数 | 说明 | 类型 | 默认值 | 必须 |\n| --- | --- | --- | ---  | --- |\n| className | 样式类名 | string | -- |  false |\n| elements | 元素配置 | ElementProps[] | -- |  true |\n| form | 返回一个对象包含update，remove，add方法 | (form: any) => void | -- |  true |\n| onChange | 得到的值 | (formData: any, key: string, value: any) => void | -- |  true |\n\n#### ElementProps\n\n| 参数 | 说明 | 类型 | 默认值 | 必须 |\n| --- | --- | --- | ---  | --- |\n| type | 类型 label/picker/datePicker/dropDown/checkbox/input/editableLabel | string | -- |  true |\n| left | label值 | any | -- |  true |\n| right | 右值，显示的值 | any | -- |  false |\n| className | 样式名 | string | -- |  false |\n| itemExtra | item扩展在item下面 | ReactElement | -- |  false |\n| itemExtraCls | item扩展样式 | string | -- |  false |\n| ...other | 其他属性，不同的type对应着不同的属性，请查看相关组件的属性值，另当type为picker属性新增pickerValueFormat转换picker的输出值 | string | -- |  false |\n\n#### form\n\n| 参数 | 说明 | 类型 | 默认值 | 必须 |\n| --- | --- | --- | ---  | --- |\n| update | 更新组件的内容，包括right等，示例 { key: { right: '1111' } } | key/value | -- |  false |\n| remove | 删除行, 包含key的数组 | [] | -- |  false |\n| add | ElementProps再加一个初入位置的属性 elementIndex，其他和ElementProps一样 | key/value | -- |  false |\n"},function(e,t){e.exports="---\ncategory: '基本'\nsubCategory: 'InputItem'\n---\n\n\n## InputItem\n\n---\n\n### 代码演示\n\n```js\nclass Demo extends React.Component {\n  render() {\n    return (\n      <InputItem label=\"实验\" extra=\"元\"\n        onChange={value => console.log('onChange', value)}\n        onFocus={value => console.log('onFocus', value)}\n        onBlur={value => console.log('onBlur', value)}\n        value=\"22222\" />\n    )\n  }\n}\n\n```\n\n### Api\n\n| 参数 | 说明 | 类型 | 默认值 | 必须 |\n| --- | --- | --- | ---  | --- |\n| type | 类型 label/picker/datePicker/dropDown/checkbox/input/editableLabel | string | -- |  true |\n| left | label值 | string | -- |  true |\n| right | 右值，显示的值 | string | -- |  false |\n| className | 样式名 | string | -- |  false |\n| itemExtra | item扩展在item下面 | ReactElement | -- |  false |\n| itemExtraCls | item扩展样式 | string | -- |  false |\n| elementEvent | 元素时间，每个组件不一样，input是onblur，picker为onConfirm，checkbox为onChange等 | (value: any) => void | -- |  true |"},function(e,t){e.exports='---\ncategory: \'展示\'\nsubCategory: \'Icon 字体图标\'\n---\n\n## Icon 字体图标\n\n字体图标\n\n---\n\n### 代码演示\n\n```js\nclass Demo extends React.Component {\n\n  render () {\n    const iconList = ["lumi","luleyuan6